function callSearch(){
	displayLoader();
	appendData="";
	if(searchText=="")
		searchText=" ";
	$.ajax({
		 type:"POST",
		 url : "/products/configurator/search",
		 contentType: "application/json; charset=utf-8", 
		 dataType : "text",
		 cache: false,
		 data : JSON.stringify({
			 "ssoId":ssoId,
			 "searchText":searchText
			 })
	}).done(function(jsonData){
		if(jsonData!=""){
			jsonData=JSON.parse(jsonData);		
			$(".viewAllSearch .viewMore .viewMoreList").empty();
			for(counter=0;counter<jsonData.length;counter++){
				date=jsonData[counter].date.split(" ");
				date=date[0].split("-");
				var mon=months[date[1]-1];
				appendData+="<li class='searchContent toolTipStyle " ;
				if(jsonData[counter].flag=="PU"){
					appendData+="projectNotification";  
				}
				else if(jsonData[counter].flag=="PO"){
					appendData+="projectOwnerNoti";
				}
				else if(jsonData[counter].flag=="CO"){
					appendData+="commentOwnerNoti";
				}
				else{
					appendData+="commentNotification";
				}
				appendDesignData="";
				$.each(jsonData[counter].designs,function(){
					appendDesignData+="<li>"+this.designName+"<input type='hidden' class='searchDesId' value='"+this.designId+"'><input type='hidden' class='searchDesFlg' value='"+this.designFlag+"'><input type='hidden' class='desTechId' value='"+this.techId+"'><input type='hidden' class='desFlow' value='"+this.flow+"'></li>"
				})
				appendData+= "'><b>"+ jsonData[counter].name+"</b><i class='pull-right'>"+date[2]+" "+mon +" "+date[0]+"</i>";
				if(jsonData[counter].isLock==1){
					appendData+="<input type='hidden' class='searchProjId' value='"+jsonData[counter].id+"' /><input type='hidden' class='searchProjOwnId' value='"+jsonData[counter].ssoId+"' /><ul class='searchDesigns'>"+appendDesignData+"</ul><a class='bottomArrow'>Owned by "+jsonData[counter].designBy+"</a></li>";
				}else{
					appendData+="<input type='hidden' class='searchProjId' value='"+jsonData[counter].id+"' /><input type='hidden' class='searchProjOwnId' value='"+jsonData[counter].ssoId+"' /><ul class='searchDesigns'>"+appendDesignData+"</ul><a class='bottomArrow'>Owned by "+jsonData[counter].designBy+"</a></li>";
				}
			}
			$(".viewAllSearch .viewMore .viewMoreList").append(appendData);
			appendData="";
			var fCount= parseInt($('.paging').find('#fCount').text());
            var tCount = parseInt($('.paging').siblings('ul').children().length);//parseInt($('.paging').siblings('ul').find('li').length);
            var entry= 10;
            var lCount = parseInt($('.paging').find('#lCount').text());
            $('.paging').find('#tCount').text(tCount);
            $('.paging').siblings('ul').find('>li').css('display','none');
            for(i=fCount;i<(fCount+entry);i++){
                  $('.paging').siblings('ul').find(">li:nth-child("+i+")").css('display','block');
            }
            $('.paging').find('#lCount').text(fCount+entry-1);
            
            if(tCount<($('.paging').find('#lCount').text())){
                  $('.paging').find('#lCount').text(tCount)
            }
            if($('.paging').find('#lCount').text()==tCount){
                  $('.paging').find('.next').addClass('disabled');
            }else{
                  $('.paging').find('.next').removeClass('disabled');
            }
            lCount = parseInt($('.paging').find('#lCount').text());
			jsonData="";
			hideLoader();
			$("#viewMorePopUp").show();
		}
		else{
			$(".viewAllSearch .viewMore .viewMoreList").empty();
			appendData+="<li>No Data Available</li>" ;
			$(".viewMore .viewMoreList").append(appendData);
			appendData="";
			jsonData="";
			hideLoader();
		}
	}).fail(function(){
		displayLoader();
		$(".viewAllSearch .viewMore .viewMoreList").empty();
		appendData+="<li>No Data Available</li>" ;
		$(".viewAllSearch .viewMore .viewMoreList").append(appendData);
		appendData="";
		jsonData="";
		hideLoader();
	});
}

