function Line(x1,y1,x2,y2){
	this.x1=x1;
	this.y1=y1;
	this.x2=x2;
	this.y2=y2;
}

Line.prototype.drawWithArrowheads=function(ctx,direction){
	// draw the line
	ctx.beginPath();
	ctx.moveTo(this.x1,this.y1);
	ctx.lineTo(this.x2,this.y2);
	ctx.stroke();
	
	if(direction == "right" || direction == "left"){
		var endRadians=Math.atan((this.y2-this.y1)/(this.x2-this.x1));
		endRadians+=((this.x2>this.x1)?90:-90)*Math.PI/180;
		this.drawArrowhead(ctx,this.x2,this.y2,endRadians);
	}else if(direction == "bottom"){
		var endRadians=Math.atan((this.x2-this.x1)/(this.y2-this.y1));
        endRadians+=((this.y2 >= this.y1)?-90:90)*Math.PI/90;
        this.drawArrowhead(ctx,this.x2,this.y2,endRadians);
	}else if(direction == "top"){
		var startRadians=Math.atan((this.y1-this.y2)/(this.x1-this.x2));
        startRadians+=((this.y1 >= this.y2)?-90:90)*Math.PI/180;
        this.drawArrowhead(ctx,this.x2,this.y2,startRadians);
	}
}
Line.prototype.drawArrowhead=function(ctx,x,y,radians){
	ctx.save();
	ctx.beginPath();
	ctx.translate(x,y);
	ctx.rotate(radians);
	ctx.moveTo(0,0);
	ctx.lineTo(5,10);
	ctx.lineTo(-5,10);
	ctx.closePath();
	ctx.restore();
	ctx.fill();
}
function drawArc(x, y, radius, startAngle, endAngle){
	ctx.beginPath();
	ctx.arc(x, y, radius, startAngle, endAngle, false);
	ctx.lineWidth = 1;
	ctx.strokeStyle = 'black';
	ctx.stroke();
}
function convertToFt(unit,caseNum,comp){
	var isConvertable=compProp.unitConversion;
	if(comp!=""){
		var num=comp.propertyDefaultValue[caseNum];
		var dispUnit=comp.propertyDisplayUnit;
		var convertedValue=comp.propertyDefaultValue[caseNum];
		if(isConvertable=="Y"){
			if(comp.multiplier=="null"){
				comp.multiplier=1;
			}
			if(!isNaN(convertedValue)){
				convertedValue*=comp.multiplier;
				convertedValue=parseFloat(convertedValue)+parseFloat(comp.offset);
			}
			if(comp.signDigit==-1 || isNaN(convertedValue)){
				return (convertedValue+" "+dispUnit);
			}else{
				return (Number(convertedValue).toFixed(comp.signDigit)+" "+dispUnit);
			}
		}else{
			return (Number(num).toFixed('2')+" "+dispUnit);
		}
	}else{
		var num=caseNum;
		if(isConvertable=="Y"){
			return (Number(num)+" ft");
		}else{
			if(unit=="ft"){
				return (Number(((num/3.28).toFixed('2')))+" m");
			}
		}
		
	}
}

