//function to trim values 
$.fn.newToFixed=function(x){
	var isConvertable=compProp.unitConversion;
	var convertedValue=this[0].propertyDefaultValue[x];
	var propId=this[0].pdmpropertyMasterIdentifier;
	if(this[0].multiplier=="null"){
		this[0].multiplier=1;
	}
	//while converting values that has X in it, need to seperate string and convert
	var val1=convertedValue.split("x")[0];
	var val2=convertedValue.split("x")[1];
	if(convertedValue.split("x").length>1){
		if(convertedValue!=""){
			if(isConvertable=="Y"){
				val1*=this[0].multiplier;
				val1=parseFloat(val1)+parseFloat(this[0].offset);
				val2*=this[0].multiplier;
				val2=parseFloat(val2)+parseFloat(this[0].offset);
				val1=Number(val1).toFixed(this[0].signDigit)
				val2=Number(val2).toFixed(this[0].signDigit)
				convertedValue=val1+" x "+val2;
			}
		}
	}else{
		if(convertedValue!=""){
			if(isConvertable=="Y" && !isNaN(convertedValue)){
				convertedValue*=this[0].multiplier;
				convertedValue=parseFloat(convertedValue)+parseFloat(this[0].offset);
			}
		}
	}
	
	if(this[0].signDigit==-1 || isNaN(convertedValue)){
	}else if(this[0].pdmpropertyMasterIdentifier=="413"){
		convertedValue=Number(Number(convertedValue).toFixed(this[0].signDigit)).toLocaleString();//(Number(convertedValue).toLocaleString()).toFixed(this[0].signDigit);
	}else{
		if(convertedValue==""){
		}else{
			convertedValue=Number(convertedValue).toFixed(this[0].signDigit)
		}
	}
	if(convertedValue.toString().split('.')[1]==0){
		convertedValue=convertedValue.split('.')[0];
	}
	return convertedValue;
}

//function to trim values on Summary Reports and 1500 canvas
$.fn.newToFixedsum=function(x){
	if(x=="0"){
		var convertedValue = this[0].maxCaseValue;
	}else{
		var convertedValue=this[0].propertyDefaultValue[x];
	}
	if(this[0].multiplier=="null"){
		this[0].multiplier=1;
	}
	if(this[0].offset=="null" || this[0].offset==""){
		this[0].offset=0;
	}
	if(convertedValue!=""){
		if(!isNaN(convertedValue)){
			convertedValue*=this[0].multiplier;
			convertedValue=parseFloat(convertedValue)+parseFloat(this[0].offset);
		}
	}
	
	if(this[0].digits==-1 || isNaN(convertedValue)){
	}else if(this[0].pdmpropertyMasterIdentifier=="413"){
		convertedValue=Number(Number(convertedValue).toFixed(this[0].digits)).toLocaleString();//(Number(convertedValue).toLocaleString()).toFixed(this[0].signDigit);
	}else{
		if(convertedValue==""){
		}else{
			convertedValue=Number(convertedValue).toFixed(this[0].digits)
		}
	}
	convertedValue = convertedValue.toString().split(".");
	convertedValue[0] = convertedValue[0].replace(/(\d)(?=(\d\d\d)+(?!\d))/g, "$1,");
	if(convertedValue.length > 1){
		convertedValue = convertedValue[0]+"."+convertedValue[1];
	}else{
		convertedValue = convertedValue[0];
	}
	convertedValue = convertedValue.toString()//.replace(/(\d)(?=(\d\d\d)+(?!\d))/g, "$1,")//To format numbers
	return convertedValue;
}

//function to trim values on Summary Reports canvas Export
$.fn.newToFixedsumReport=function(x){
	var convertedValue=this[0].propertyDefaultValue[x];
	var digits = this[0].digits;
	var propIdArr=["1148","1149","1145","1146","1232","1233","1358","1359","1442","1443","1295","1296"];//prop with these ids should have 0 decimal places
	var propArray=["1148","1149","1169","1170","1190","1191","1211","1212","1232","1233","1253","1254","1274","1275","1295","1296","1316","1317","1337","1338","1358","1359","1379","1380","1421","1422","1442","1443","1463","1464","1484","1485"];
	var rangeProp=["1943","1945","1953"]
	if(this[0].fromUnit == "s" || this[0].fromUnit == "sec" || this[0].fromUnit == "kg/m3" || this[0].fromUnit == "mg/L" || $.inArray(this[0].pdmpropertyMasterIdentifier,propIdArr)!=-1){// To set decimal places to 0
		digits = 0;
	}
	var propArrayExcption=["4696"];//props should not have 0 decimal places
	if($.inArray(this[0].pdmpropertyMasterIdentifier,propArrayExcption)!=-1){// To set decimal places with required digits
		digits = this[0].digits;
	}
	if(this[0].multiplier=="null"){
		this[0].multiplier=1;
	}
	if(this[0].offset=="null" || this[0].offset==""){
		this[0].offset=0;
	}
	if(convertedValue!=""){
		if(!isNaN(convertedValue)){
			convertedValue*=this[0].multiplier;
			convertedValue=parseFloat(convertedValue)+parseFloat(this[0].offset);
		}else if($.inArray(this[0].pdmpropertyMasterIdentifier,rangeProp)!=-1 && this[0].digits!=-1){
			convertedValue=convertedValue.split("-")
			convertedValue[0]*=this[0].multiplier;
			convertedValue[0]=parseFloat(convertedValue[0])+parseFloat(this[0].offset);
			convertedValue[1]*=this[0].multiplier;
			convertedValue[1]=parseFloat(convertedValue[1])+parseFloat(this[0].offset);
			convertedValue=convertedValue.join("-");
		}
	}
	
	if(this[0].digits==-1 || isNaN(convertedValue)){
		if($.inArray(this[0].pdmpropertyMasterIdentifier,rangeProp)!=-1 && this[0].digits!=-1){
			convertedValue=convertedValue.split("-")
			convertedValue[0]=Number(convertedValue[0]).toFixed(digits);
			convertedValue[1]=Number(convertedValue[1]).toFixed(digits);
			convertedValue=convertedValue.join("-");
		}
	}else if(this[0].pdmpropertyMasterIdentifier=="413"){
		convertedValue=Number(Number(convertedValue).toFixed(digits)).toLocaleString();//(Number(convertedValue).toLocaleString()).toFixed(this[0].signDigit);
	}else{
		convertedValue=Number(convertedValue).toFixed(digits)
	}
	if(this[0].pdmpropertyMasterIdentifier=="2158" || this[0].pdmpropertyMasterIdentifier=="2241"){//For Opportunity number , formatting and digits should not be there
		if(!isNaN(convertedValue))
		convertedValue=Number(convertedValue).toFixed(0);
	}else if(this[0].pdmpropertyMasterIdentifier == "2099"){//For Membrane type , formatting and digits should not be there
		convertedValue=convertedValue.toString();
	}else{
		convertedValue=convertedValue.toString().replace(/(\d)(?=(\d\d\d)+(?!\d))/g, "$1,")//To format numbers
	}
	
	return convertedValue;
}

//function to keep only the edited components 
function editJson(){
	globalJSONTemp=JSON.stringify(globalJSON);
	$.each(globalJSON.components,function(index){
		/////////Calculate the length of the property group of the component//////////////////////////////////
		 var propGrpLen=globalJSON.components[index].propertyGroup.length;
		 var propCaseCount;
		$.each(this.propertyGroup,function(propGrpInd){
			var propEdittedCount=0;
			$.each(this.componentPropertyList,function(propInd){
				propCaseCount=globalJSON.caseStatus.length;
				$.each(globalJSON.caseStatus,function(caseNum){
	////////////////If the property is not editted, delete that property from the component/////////////////////////////
					if(globalJSON.components[index].propertyGroup[propGrpInd].componentPropertyList[propInd].isDataModified[caseNum]=="N"){
						//delete globalJSON.components[index].propertyGroup[propGrpInd].componentPropertyList[propInd];
						propCaseCount-=1;
					}else{
						propEdittedCount+=1;
					}
				})
				//////////////If any of the case data are editted,dont delete that case//////////
				if(propCaseCount==0){
					delete globalJSON.components[index].propertyGroup[propGrpInd].componentPropertyList[propInd];
				}

			})
//////////////////////////If propEdittedCount variable is 0 , thn none of the properties of that grp are editted/////////////////////////////////
			if(propEdittedCount==0){
				delete globalJSON.components[index].propertyGroup[propGrpInd];
				propGrpLen-=1;
			}
		////////////////////If propGrpLen is 0, all the propertygrp are deleted, hence the property group element of the component can be deleted///////////////////
			if(propGrpLen==0){
				delete globalJSON.components[index].propertyGroup;
			}
		})
	});
}
