//function to update components
function initializeComponents(isModalOpen){
	compProp=""
	data=JSON.stringify({"ssoId":ssoId,"projectId":selectedProjId,"designId":shareDesId,"unitType":unitType,"techId":technoId});
	var firstReq=$.ajax({
		type:"POST",
		url :"/products/designcloud/loadExistingDesignComp",
		contentType: "application/json; charset=utf-8", 
		dataType : "text",
		data : data,
		cache: false
	})
	var secondReq=$.ajax({//Line sizing data are required to work with biofilters
		 type:"POST",
		 url : "/products/designcloud/lineSizing",
		 contentType: "application/json; charset=utf-8", 
		 dataType : "text",
		 cache: false,
		 data : JSON.stringify({"data":""})
	})
	var getDesDetails = $.ajax({
		type:"POST",
		 url : "/products/designcloud/designDetails",
		 contentType: "application/json; charset=utf-8", 
		 dataType : "text",
		 cache: false,
		 data : JSON.stringify({"technoId":technoId,"designId":shareDesId})
	});
	$.when(firstReq, secondReq,getDesDetails).done(function(json1,secondRes,desData){
			if(json1[0]!="" && json1[0]!='""'){
				isExists="N";
				compProp=json1[0];
				compProp=JSON.parse(compProp);
				compProp.stageSwape="N";
				globalJSON=JSON.parse(JSON.stringify(compProp));
				if(isOldDesign()){
					$(".oneStage,.twoStage").addClass("disabled");
				}else{
					$(".oneStage,.twoStage").removeClass("disabled");
				}
				//For the new revision of own projects
				if(shareDesIndex!='new' && shareDesIndex!="search" && shareDesIndex!="notification" && shareDesIndex!='userMgmnt' ){
					if((compProp.degnVersion < compProp.latestVersion) || projects[projIndex].flag=="NE"){
						if(compProp.degnVersion < compProp.latestVersion){
							$(".revisionWarn").show();
						}else{
							$(".revisionWarn").hide();
						}
						if(projects[projIndex].flag=="NE"){
							$(".revisionWarn").hide();
						}
						$(".userActionsMenu .save,.designTemplate li").addClass("disabled");
						
					}else{
						$(".userActionsMenu .save,.designTemplate li").removeClass("disabled");
					}
				}else{//For project opened through outer search
					if(isNewRevision()){
						if(searchedProjStatus!="PU"){
							$(".userActionsMenu .save,.designTemplate li").removeClass("disabled");
							if(compProp.degnVersion < compProp.latestVersion){//old design
								$(".revisionWarn").show();			//If design is of old revision & own proj show the warning message.
							}else{
								$(".revisionWarn").hide();	
							}
						}else{
							$(".userActionsMenu .save,.designTemplate li").addClass("disabled");
							$(".revisionWarn").hide();
						}
					}else{
						$(".userActionsMenu .save ,.designTemplate li").addClass("disabled");
						if(searchedProjStatus=="PO"){
							$(".revisionWarn").show();
						}else{
							$(".revisionWarn").hide();
						}
					}
				}
				if(compProp.stageNo==1){
					stgId=1;
					callLoadDesignCan(false);
				}else{
					stgId=2;
					callLoadDesignCan(false);
				}
				if(isModalOpen){
					displayModal();
				}
				if(secondRes[0]!=""){
					lineSizData=JSON.parse(secondRes[0]);
					$.each(lineSizData,function(index){
						//Check for empty || - so that array wont be NaN
						if(this.cirTankDiameter!="" && this.cirTankDiameter!="-"){
							linSizDia[index]=Number(this.cirTankDiameter).toFixed(1);
						}else{
							linSizDia[index]="-";
						}
						if(this.squareTankLength!="" && this.squareTankLength!="-"){
							linSizLen[index]=Number(this.squareTankLength).toFixed(1);
						}else{
							linSizLen[index]="-";
						}
						if(this.cirTankDiameter_M!="" && this.cirTankDiameter_M!="-"){
							linSizDiaM[index]=Number(this.cirTankDiameter_M).toFixed(1);
						}else{
							linSizDiaM[index]="-";
						}
						if(this.squareTankLength_M!="" && this.squareTankLength_M!="-"){
							linSizLenM[index]=Number(this.squareTankLength_M).toFixed(1);
						}else{
							linSizLenM[index]="-";
						}
					})
				}else{
					comProp="";
					$(".modal-footer .closeBtn ").trigger('click'); 	 	
					saveConfirmFlag="";
					$("#failureMessage").show(250)
					$("#failureMessage .message").show(250).html("System error. Please try again.");
					getLandingPage(); 	 
					lockUnlockProj("unlock");
				}
			}else{
				comProp="";
				$(".modal-footer .closeBtn ").trigger('click'); 	 	
				saveConfirmFlag="";
				$("#failureMessage").show(250)
				$("#failureMessage .message").show(250).html("System error. Please try again.");
				getLandingPage(); 	 
				lockUnlockProj("unlock");
			}
			if(desData[0]!=""){
				populateDesignDetBand(desData[0]);
			}else{
				$("#failureMessage").show(250);
				$("#failureMessage .message").show(250).html("System error. Please try again.");
			}
		}).fail(function(){
			comProp="";
			$(".modal-footer .closeBtn ").trigger('click'); 	 	
			saveConfirmFlag="";
			$("#failureMessage .message").show(250).html("System error. Please try again.");
			getLandingPage();
			lockUnlockProj("unlock");
		});
}


