//Function to load the new Design
function callLoadDesign(targetLink){
	//To hide the info band
	$("#createDesignPopup #infoMessages").hide();
	displayLoader();
	var unitType;
	if(targetLink != "newDesignComp")
		{
		 unitType=compProp.unitType;
		}
	else{
		unitType=$("#unitCon").val();
	}
	//Ganesh End: Fix to pass the unit type for stage swap
	$.ajax({
			type : "POST",
			 url : "/products/designcloud/loadDesignComp",
			 contentType: "application/json; charset=utf-8", 
			 dataType : "json",
			 cache: false,
			 data:JSON.stringify({
					"ssoId":ssoId,
					"stageId":stgId,
					"projectId":selectedProjId,
					"techId":"1",
					"unitType":unitType
				})
		}).done(function(jsonData){
			if(targetLink=="newDesignComp"){
				if(jsonData!=""){
					compProp=JSON.parse(JSON.stringify(jsonData));
					globalJSON=JSON.parse(JSON.stringify(compProp));
					fillWizPropAbmet();
					$("#tech").prop("disabled",false);
					$("#wizDesName").prop("disabled",false).val("Design "+(designCount+1));
				}else{
					$('#createDesignPopup').hide(250);
					$("#failureMessage .message").show(250).html("System error. Please try again.");
				}
			}else if(targetLink=="swap2to1"){
				if(jsonData!=""){
					$(".designTemplate li").removeClass('activeDesign');
					$(".oneStage ").addClass('activeDesign');
					
					//deleting components from the current json having stage 1 json as reference.
					var currentArray=[],newArray=[],excludeMe=[]
					$.each(jsonData.components,function(){
						newArray.push(this.componentIdentifier)
					});
					$.each(globalJSON.components,function(){
						currentArray.push(this.componentIdentifier)
					});
					for(i in currentArray){
						if($.inArray(currentArray[i],newArray)==-1){
							excludeMe.push(currentArray[i]);//components to be deleted from current array to make it stage 1
						}
					}
					//json conversion from stage 2 to stgae 1
					globalJSON.stageNo="1";
					finalStageDesign.stageNo="1";
					newArray=[];
					$.each(globalJSON.components,function(i){
						if($.inArray(this.componentIdentifier,excludeMe)!=-1){
							newArray.push(i);
						}
					})
					$.each(newArray,function(i){
						globalJSON.components.splice((this-i),1);
					})
					
					//make whole global json marked as edited for save 
					stgId='1';
					callLoadDesignCan(false);
					setFinalStageDesignVal()
					hideLoader();
				}else{
					displayLoader();
					getLandingPage();
					lockUnlockProj("unlock");
					var getViewMainPage = setInterval(function(){
						if($(".landingPageContent").is(':visible')){
							displayLoader();
							$("#failureMessage .message").show(250).html("System error. Please try again.");
							$("#failureMessage").show(250);
							clearInterval(getViewMainPage)
						}
					}, 250);
				}
			}else if(targetLink=="swap1to2"){
				if(jsonData!=""){
					$(".designTemplate li").removeClass('activeDesign');
					$(".twoStage ").addClass('activeDesign');
					
					var currentArray=[],newArray=[],excludeMe=[];
					$.each(globalJSON.components,function(){
						currentArray.push(this.componentIdentifier)
					});
					$.each(jsonData.components,function(){
						if($.inArray(this.componentIdentifier,currentArray)==-1){
							globalJSON.components.push(this)
						}
					})
					//make whole global json marked as edited for save 
					globalJSON.stageNo="2";
					finalStageDesign.stageNo="2";
					stgId='2';
					callLoadDesignCan(false);
					setFinalStageDesignVal();
					hideLoader();
				}else{
					displayLoader();
					getLandingPage();
					lockUnlockProj("unlock");
					var getViewMainPage = setInterval(function(){
						if($(".landingPageContent").is(':visible')){
							displayLoader();
							$("#failureMessage .message").show(250).html("System error. Please try again.");
							$("#failureMessage").show(250);
							clearInterval(getViewMainPage)
						}
					}, 250);
				}
			}
		}).fail(function(){
			$('#createDesignPopup').hide(250);
			displayLoader();
			$(".modal-footer .closeBtn ").trigger('click');
			saveConfirmFlag="";
			getLandingPage();
			lockUnlockProj("unlock");
			var getViewMainPage = setInterval(function(){
				if($(".landingPageContent").is(':visible')){
					displayLoader();
					$("#failureMessage .message").show(250).html("System error. Please try again.");
					$("#failureMessage").show(250);
					clearInterval(getViewMainPage)
				}
			}, 250);
		})
}

//Function to differentiate between old and new revision
function isNewRevision(){
	if(globalJSON.degnVersion == globalJSON.latestVersion){
		return true;
	}else{
		return false;
	}
}
//fuction to load the canvas attributes
function callLoadDesignCan(targetLink){
	//Design version flag will be 0 even for the new template but of old revision
	function newDesign(){
		if(globalJSON.components.length==15 || (globalJSON.components.length==19 && globalJSON.stageNo== 2)){//Old Revision stage 2 and new revision stage 1 have same number of components
			return false;
		}else if(globalJSON.components.length>=23 || (globalJSON.components.length>=19 && globalJSON.stageNo== 1)){
			return true;
		}
	}
	//isNewRevision Function returns true or false
	if(newDesign()){
		if(globalJSON.stageNo== 1){
			finalStageDesign=JSON.parse(newStage1DesignJSON)
		}else{
			finalStageDesign=JSON.parse(newStage2DesignJSON)
		}
	}else{
		if(globalJSON.stageNo== 1){
			finalStageDesign=JSON.parse(oldStage1DesignJSON)
		}else{
			finalStageDesign=JSON.parse(oldStage2DesignJSON)
		}
	}
	if(targetLink!="newDesign"){
		initializeCanvas();
	}
	hideLoader();
}

