//checking conditions for stage swap
	//stage 2 to stage 1
	function stage2cond(){
		var effVal=[],FeedSourceVal=[],result=[];
		$.each(compProp.components,function(){
			if(this.componentIdentifier=="C00001"){
				$.each(this.propertyGroup,function(){
					if(this.propertyGroupName=="Influent"){
						$.each(this.componentPropertyList,function(){
							if(this.pdmpropertyMasterIdentifier=="19"){
								for (i in this.propertyDefaultValue){
									if(compProp.caseStatus[i-1]=="1")//only if the case is active
									FeedSourceVal.push(Number(this.propertyDefaultValue[i]))
								}
								return false;
							}
						})
					}else if(this.propertyGroupName=="Effluent"){
						$.each(this.componentPropertyList,function(){
							if(this.pdmpropertyMasterIdentifier=="633"){
								for (i in this.propertyDefaultValue){
									if(compProp.caseStatus[i-1]=="1")//only if the case is active
									effVal.push(Number(this.propertyDefaultValue[i]))
								}
								return false;
							}
						})
					}
				})
			}else if(this.componentIdentifier=="C00032"){// get Effluent
				$.each(this.propertyGroup,function(){
					$.each(this.componentPropertyList,function(){
						if(this.pdmpropertyMasterIdentifier=="633"){
							for (i in this.propertyDefaultValue){
								if(compProp.caseStatus[i-1]=="1")//only if the case is active
								effVal.push(Number(this.propertyDefaultValue[i]))
							}
							return false;
						}
					})
				});
			}
		})
		for(i in effVal){
			if(effVal[i]<10 || ((FeedSourceVal[i]-effVal[i])/FeedSourceVal[i])>0.9){
				result.push(Number(i)+1);
			}
		}
		return result;
	}
	//stage 1 to stage 2
function stage1cond(){
	var effVal=[],FeedSourceVal=[],result=[];
	$.each(compProp.components,function(){
		if(this.componentIdentifier=="C00001"){
			$.each(this.propertyGroup,function(){
				if(this.propertyGroupName=="Influent"){
					$.each(this.componentPropertyList,function(){
						if(this.pdmpropertyMasterIdentifier=="19"){
							for (i in this.propertyDefaultValue){
								if(compProp.caseStatus[i-1]=="1")//only if the case is active
								FeedSourceVal.push(Number(this.propertyDefaultValue[i]))
							}
							return false;
						}
					})
				}else if(this.propertyGroupName=="Effluent"){//get effluent in old stage 1 &2
					$.each(this.componentPropertyList,function(){
						if(this.pdmpropertyMasterIdentifier=="633"){
							for (i in this.propertyDefaultValue){
								if(compProp.caseStatus[i-1]=="1")//only if the case is active
								effVal.push(Number(this.propertyDefaultValue[i]))
							}
							return false;
						}
					})
				}
			})
		}else if(this.componentIdentifier=="C00032"){// get effluent in new stage 1 &2
			$.each(this.propertyGroup,function(){
				$.each(this.componentPropertyList,function(){
					if(this.pdmpropertyMasterIdentifier=="633"){
						for (i in this.propertyDefaultValue){
							if(compProp.caseStatus[i-1]=="1")//only if the case is active,value of propertyDefaultValue starts with 1, whereas caseStatus start with 0
							effVal.push(Number(this.propertyDefaultValue[i]))
						}
						return false;
					}
				})
			})
		}
	})
	for(i in effVal){
		if(effVal[i]>10 && ((FeedSourceVal[i]-effVal[i])/FeedSourceVal[i])<0.9){
			result.push(Number(i)+1);
		}
	}
	return result;
}



