function zoomInOut(a){ 
    divZoom=a
    $("#canvasImages").css({ transform: "scale("+divZoom+")"});
    if(divZoom==0.7){$("#canvasImages").animate({top:"-60px",left:"-120px"},400);}
    else if(divZoom==0.8){$("#canvasImages").animate({left:"-85px"},400);}
    else if(divZoom==0.9){$("#canvasImages").animate({top:"-15px",left:"-35px"},400);}
    else if(divZoom==1){$("#canvasImages").animate({top:"0px",left:"0px"},400);}
    return false;
}
 
