//To fill the create design wizard for ABMet
function fillWizPropAbmet(){
	//filling values
	$.each(compProp.components,function(){
		$.each(this.propertyGroup,function(){
			$.each(this.componentPropertyList,function(){
				if(this.pdmpropertyMasterIdentifier=="1"){//designFeedFlow
					$("#createDesignPopup input[name='designFeedFlow']").val($(this).newToFixed('1'))//this.propertyDefaultValue[1])
					$("#createDesignPopup div [data-propId='1'] span").html("("+this.propertyDisplayUnit+")");
				}else if(this.pdmpropertyMasterIdentifier=="3"){//minDesignTemperature
					$("#createDesignPopup input[name='minDesignTemperature']").val($(this).newToFixed('1'))//val(this.propertyDefaultValue[1]);
					$("#createDesignPopup div [data-propId='3'] span").html("("+this.propertyDisplayUnit+")");
				}else if(this.pdmpropertyMasterIdentifier=="7"){//nitrate
					$("#createDesignPopup input[name='nitrate']").val($(this).newToFixed('1'))//val(this.propertyDefaultValue[1]);
					$("#createDesignPopup div [data-propId='7'] span").html("("+this.propertyDisplayUnit+")");
				}else if(this.pdmpropertyMasterIdentifier=="19"){//totalSeleium
					$("#createDesignPopup input[name='totalSeleium']").val($(this).newToFixed('1'))//val(this.propertyDefaultValue[1]);
					$("#createDesignPopup div [data-propId='19'] span").html("("+this.propertyDisplayUnit+")");
				}else if(this.pdmpropertyMasterIdentifier=="15"){//inTSS
					$("#createDesignPopup input[name='inTSS']").val($(this).newToFixed('1'))//val(this.propertyDefaultValue[1]);
					$("#createDesignPopup div [data-propId='15'] span").html("("+this.propertyDisplayUnit+")");
				}else if(this.pdmpropertyMasterIdentifier=="633"){//totalSeleniumEff
					$("#createDesignPopup input[name='totalSeleniumEff']").val($(this).newToFixed('1'))//val(this.propertyDefaultValue[1]);
					$("#createDesignPopup div [data-propId='633'] span").html("("+this.propertyDisplayUnit+")");
				}else if(this.pdmpropertyMasterIdentifier=="630"){//efTSS
					$("#createDesignPopup input[name='efTSS']").val($(this).newToFixed('1'))//val(this.propertyDefaultValue[1]);
					$("#createDesignPopup div [data-propId='630'] span").html("("+this.propertyDisplayUnit+")");
				}else if(this.pdmpropertyMasterIdentifier=="427"){//EBCT
					$("#createDesignPopup input[name='EBCT']").val($(this).newToFixed('1'))//val(this.propertyDefaultValue[1]);
					$("#createDesignPopup div [data-propId='427'] span").html("("+this.propertyDisplayUnit+")");
				}
			})
		})
	})
	$('#createDesignPopup input[name="totalSeleium"]').trigger('keyup');
	$("#createDesignPopup .newOverlay,#createDesignPopup .newOverlayLoader").hide();
	$("#createDesignPopup").css({"zIndex":"1002"});
	$('#createDesignPopup,#createDesignPopup .newDsgnPopUpCompProp').show(250);
	$("#createDesignBtnProp").hide();
	$("#createDesignBtn").show();
	$("#createDesignPopup .message").hide();
}
