//To show CoachMark
function setCookie(cname,cvalue,exdays) {
	//alert("set");
		var d = new Date();
		d.setTime(d.getTime() + (exdays*24*60*60*1000));
		var expires = "expires=" + d.toGMTString();
		document.cookie = cname+"="+cvalue+"; "+expires;
		if(cname == "cookie1"){
			var pos1=$(".createProject").offset();
			var pos2=$(".existingProjectImage").offset();
			var pos3=$(".searchText ").offset();
			var pos4=$("#projectList").offset();
			$(".target-menu-toggle").css({left:pos1.left-23 ,top:pos1.top+7});
			$(".target-customize-store").css({left:pos2.left-38 ,top:pos2.top-96});
			$(".target-homepage").css({left:pos3.left ,top:pos3.top+10});
			$(".target-search").css({left:pos4.left+360 ,top:pos4.top-180});
			if($(".landingPageContent").length){//Only if landing page is visible
				$('#intro-overlay').show();
				if(role=="Customer"){//For Customer role, search shld not be visible
					$(".target-homepage").hide();
				}
			}
		}else{
			$('#intro-overlay').hide();
		}
}
//To show CoachMark
function getCookie(cname) {
		var name = cname + "=";
		var ca = document.cookie.split(';');
		for(var i=0; i<ca.length; i++) {
			var c = ca[i];
			while (c.charAt(0)==' ') c = c.substring(1);
			if (c.indexOf(name) == 0) {
				return c.substring(name.length, c.length);
			}
		}
		return "";
}
//To show CoachMark
function checkCookie(cookieName) {
		var user=getCookie(cookieName);
		if (user != "") {
			$('#intro-overlay').hide();
		} else if(user==""|| user==null){
			   setCookie(cookieName, "coach", 30);
		}
		
}

