function onLoadDataFluidProp(compIndex){
	
	$.ajax({
		type : "POST",
		url :"/products/configurator/loadSingleComp",
		contentType: "application/json; charset=utf-8",
        dataType : "json",
        cache: false,
		data :JSON.stringify({"ssoId":ssoId,"projectId":selectedProjId,"designId":shareDesId,"compId":compId,"techId":"1"})
	}).done(function(jsonData){
		if(jsonData!=""){
		
			//clear prev component
			$(".modal .compPropPopup .nav-tabs, .modal .compPropPopup .tab-content").empty();
			$("#infoMessages").hide();
			$(".compPropPopup .popOverlay").hide(250);
			//var compArray=globalJSON.components[0];//globalJSON.components[compIndex];
			var compArray=jsonData[0];
			conversionList = jsonData[3];
			sparesList=jsonData[2];
			calTableList=jsonData[4];
			componentData=jsonData[0].propertyGroup;
			globalJSON.components[compIndex].propertyGroup=jsonData[0].propertyGroup;
			globalJSON2.components[compIndex].propertyGroup=jsonData[0].propertyGroup;
            fuildPropJSON.components[compIndex].propertyGroup=jsonData[0].propertyGroup;
			if(compId == 'C00001'){
                spareListDeoiler = jsonData[2];
			}else if(compId == 'C00002'){
				spareListDH = jsonData[2];
			}else if(compId == 'C00003'){
				spareListWHD = jsonData[2];
			}else if(compId == 'C00004'){
				spareListIGF = jsonData[2];
			}else{
				spareListNSF = jsonData[2];
			}
			hideLoader();
		}

		})
		//hideLoader();
}

