function getAllWarnings(){
	allWarningsData = [];
	$(".warningClass").each(function(){
		var value1=$(this).text();
		var id = $(this).siblings().find(".textInput").attr("name");
			var name = $(this).closest("tr").find("p").text()
			var value = $(this).siblings().find(".textInput").attr("data-value");
			var warningId = $(this).siblings().find(".infoNote").attr("data-id");
			var warnings = infoN[warningId];
		if(value1 != "" ){
			
			allWarningsData.push({"id":id,"name":name,"value":value,"warnings":warnings});
		}
		if((id =="53" || id=="54")  && value.includes("-")){
				allWarningsData.push({"id":id,"name":name,"value":value,"warnings":"Calculated result is negative"});
		}
	});
}
//To Map selected element with JSON
function mapComptoJSON(compId){
	var componentIndex="";
	$.each(globalJSON.components,function(index){
		if(this.componentIdentifier==compId){
			componentIndex=index;
			return false;
		}
	})
	
	return componentIndex;
}

//Group json by parameter
function groupByParameter(jsonArray, groupBy){
	var groupedData = jsonArray.reduce(function(result, current) {
		  if (typeof current[groupBy] === 'undefined'){
			  current[groupBy] = "All";
		  }
		  result[current[groupBy]] = result[current[groupBy]] || [];
		  result[current[groupBy]].push(current);
		  return result;
		}, {});

	return groupedData;
}

//To populate the array with updated values
function fillPropArray(){
	$(".fsdModal").removeClass("priceTabCss");
	$.each(globalJSON.components,function(){
		if(!this.componentInstances.length){
			$.each(this.propertyGroup,function(){
				$.each(this.componentPropertyList,function(){
					propArray[this.pdmpropertyMasterIdentifier]=parseFloat(this.propertyDefaultVal);
					propArrayForm[this.pdmpropertyMasterIdentifier]=""+this.calculatedFieldFormula+"";
				})
			})
		}else{
			$.each(this.componentInstances[0].propertyGroup,function(){
				$.each(this.componentPropertyList,function(){
					propArray[this.pdmpropertyMasterIdentifier]=parseFloat(this.propertyDefaultVal);
					propArrayForm[this.pdmpropertyMasterIdentifier]=""+this.calculatedFieldFormula+"";
				})
			})
		}
	})
}

