//Funtion to load the data on admin console
function loadAdminConsole(isEditOpen,json){
	//$("#editUserPopup").hide();
	//$(".brand span:eq(1)").html("Design Cloud <small style='margin-left:5px;'><i>powered by </i>GE Water &amp; Process Technologies</small>");//Change the header name
	displayLoader();
	$(".newOverlay").show(250);
	$(".newOverlayLoader").show(250);
	$.ajax({  type:"POST",
		cache: false,
		url : "/products/configurator/getUserData"
	}).done(function(data){
		hideLoader();
		$(".newOverlay").hide(250);
		$(".newOverlayLoader").hide(250);
		jsonData=data;
		if(jsonData=="" || jsonData.usersList==null){
			displayLoader()
			$("#failureMessage").show(250);
			$("#failureMessage .message").show(250).text("System Error, Please Try Again");
			displayLoader();
			return false;
		}
		applnRoles=jsonData.roles;
		applnTech=jsonData.techList;
		 $("#userManagementTable tbody").empty();
		 $(".searchUsers").val("");//clear the search field data
		 $.each(jsonData.usersList,function(){
			 $("#userManagementTable tbody").append("<tr><td><input type='checkbox'></td><td class='userSSO' data-projCount='"+this.projectCount+"' data-value='"+this.ssoID+"'>"+this.ssoID+"</td><td>"+this.fName+"</td><td>"+this.lName+"</td><td>"+this.email+"</td><td>"+this.role+"</td><td><input type='hidden' data-value='"+this.techAccessId+"'>"+this.techAccess+"</td><td>"+this.userLevel+"</td><td>"+this.userStatus+"</td><td><a class='icon-edit editUser' title='Edit'></a></td></tr>")
		 })
		 $(".editRole").empty();
		 $.each(jsonData.roles,function(){
			 $(".editRole").append("<option class='roles' value='"+this.roleId+"'>"+this.roleName+"</option>")
		 });
		 $(".editDsgnAccess").empty();
		 $(".addUserDetails .arrowBox").empty();
		 $.each(jsonData.techList,function(){
			 $(".editDsgnAccess").append("<li class='techList' data-value='"+this.techId+"' id='tech"+this.techId+"'><input type='checkbox' for='tech"+this.techId+"'>"+this.techName+"</li>")
			 $(".addUserDetails .arrowBox").append('<div class="row"><input class="pull-left" type="checkbox" value="'+this.techId+'" id="tech'+this.techId+'" name="tech'+this.techId+'"><label class="pull-left" for="tech'+this.techId+'">'+this.techName+'</label></div>');
		 });
		 addPaginationOnTable();
		 $("#editUserPopup").css({"zIndex":"1002"});
		 $("#addUserPopup").css({"zIndex":"1002"});
		 if(isEditOpen==true){
			 $(".editUserSSO").val(json.manageUsers[0].ssoID)
				$(".editFirstName").val(json.manageUsers[0].fName)
				$(".editLastName").val(json.manageUsers[0].lName)
				$(".editEmail").val(json.manageUsers[0].email)
				$(".editRole option").each(function(){
					if($(this).val().toLowerCase().trim()==json.manageUsers[0].role.toString()){
						 $(this).prop('selected',true);
						 return false;
					 }
				})
				var techAccess=json.manageUsers[0].techAccess.split(",");
				$(".editDsgnAccess li").each(function(){
					if($.inArray($(this).attr('data-value'),techAccess)!=-1){
						$(this).find('input').prop("checked",true);
					}else{
						$(this).find('input').prop("checked",false);
					}
				});
		 }else if(isEditOpen=="addUser"){
			 $("#addUserPopup").css({"zIndex":"1002"});
		 }else{
			$("#userManagementPopUp").show();
		 }
	}).fail(function(){
		displayLoader()
		$("#failureMessage").show(250);
		$("#failureMessage .message").show(250).text("System Error, Please Try Again");
		displayLoader();
	})
}

