function addNewlines(str) {
  var result = '';
  while (str.length > 0) {
    result += str.substring(0, 29) + '\n';
    str = str.substring(29);
  }
  return result;
}

function numberWithCommas(x) {
    return x.toString().replace(/\B(?=(\d{3})+(?!\d))/g, ",");
}


